import React from 'react';
import img from '../assets/graciasc.jpg'
import {Segment} from 'semantic-ui-react'

export default function Home() {
    const picture = {
        height:'100%',
        width:'100%'
    }
  return (
    <div style={{minHeight: "99vh"}}>
      <h1> Home</h1>
      <Segment>
      <img style={{picture}} src={img}/>
      </Segment>
    </div>
  );
}
